@BergenfieldNJFD @PierceMfg Nice to see a volunteer fire department in our area purchasing a true ladder truck, no pump, tank, hose bed or pre-connects.
With all the equipment carried on apparatus these days, trucks need to be trucks &amp; engines need to be engines.
Don't put all your eggs in one basket.

